import '../SimpleForm.css';
import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import SuccessMessage from './SuccessMessage';


const SubmissionContent = ({ circle, division, subdivision }) => {
  const [formData, setFormData] = useState({
    circle: circle,
    division: division,
    subdivision: subdivision,
    month_of_year: '',
    year: '',
    injection: '',
    unit_billed: '',
    total_IRCA_collection: '',
    demand_IRCA: '',
    no_of_consumers: '',
    no_of_bill_served: '',
    total_area: '',
    billing_efficiency_permMonth: '',
    billing_efficiency_perYear: '',
  });

  // const calculateBillingEfficiencymonthly = () => {
  //   const { unit_billed, injection } = formData;

  //   const billingEfficiencymonthlyValue = (unit_billed / injection) * 100;
  //   setBillingEfficiency(billingEfficiencymonthlyValue);
  // };
  const calculateBillingEfficiencymonthly = () => {
    const { unit_billed, injection } = formData;

    // Perform the calculation and return the result
    const billingEfficiencymonthlyValue = (unit_billed / injection) * 100;
    return billingEfficiencymonthlyValue;
  };


  const calculateBillingEfficiencyYearly = (formData) => {
    // Aggregate data for each year (from April to March)
    const yearlyData = {};
    formData.forEach((item) => {
      const year = item.year;
      if (!yearlyData[year]) {
        yearlyData[year] = {
          unit_billed_total: 0,
          injection_total: 0,
          billing_efficiency_perYear: 0,
        };
      }
      yearlyData[year].unit_billed_total += item.unit_billed;
      yearlyData[year].injection_total += item.injection;
    });
        // Calculate billing_efficiency_perYear for each year
        for (const year in yearlyData) {
          yearlyData[year].billing_efficiency_perYear =
            (yearlyData[year].unit_billed_total / yearlyData[year].injection_total) * 100;
        }

        // Set the billing_efficiency_perYear back to the formData
        formData.forEach((item) => {
          item.billing_efficiency_perYear = yearlyData[item.year]?.billing_efficiency_perYear || 0;
        });

        return formData;
      };

  const [showMessage, setShowMessage] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const navigate = useNavigate(); 

  const handleSubmit = (e) => {
    e.preventDefault();


    if (formData[0]?.year) {
      formData = calculateBillingEfficiencyYearly(formData);
    }

    const billingEfficiencymonthly = calculateBillingEfficiencymonthly();

    setFormData((prevData) => ({
      ...prevData,
      billing_efficiency_permMonth: billingEfficiencymonthly,
    }));

    axios.post('/create', formData)
      .then((response) => {
        console.log(response.data); // Data saved successfully message from the backend
        // Optionally, you can handle success here or notify the user
        //navigate(-1); 
        setShowMessage(true);



        setTimeout(() => {
          navigate('/create'); 
          window.location.reload();
        }, 500); 

      })
      .catch((error) => {
        console.error('Error:', error); // Log the error if something went wrong
        // Optionally, you can handle the error or notify the user
      });
  };

  return (
    <div className="submission-content-container">
      <div className="submission-content">
      {showMessage ? (
          <SuccessMessage />
        ) : (
        <>
      <h3>Fill the additional details for monthly report</h3>

      <form onSubmit={handleSubmit}>
        <p>Circle: {circle}</p>
        <p>Division: {division}</p>
        <p>Sub-Division: {subdivision}</p>
        {/* New form for additional inputs */}

          {/* 10 input fields */}
          <div>
        <label htmlFor="month_of_year">Month:</label>
        <select
          type="text"
          id="month_of_year"
          name="month_of_year"
          value={formData.month_of_year}
          onChange={handleInputChange}
        >
          <option value="">Select Month</option>
            <option value="January">January</option>
            <option value="Febuary">Febuary</option>
            <option value="March">March</option>
            <option value="April">April</option>
            <option value="May">May</option>
            <option value="June">June</option>
            <option value="July">July</option>
            <option value="August">August</option>
            <option value="September">September</option>
            <option value="October">October</option>
            <option value="November">November</option>
            <option value="December">December</option>
          </select>
      </div>
          <div>
          <label htmlFor="year">Year:</label>
            <input
              type="number"
              id="year"
              name="year"
              value={formData.year}
              onChange={handleInputChange}
              placeholder="Enter Year"
            />
            <label htmlFor="injection">Injection:</label>
            <input
              type="number"
              id="injection"
              name="injection"
              value={formData.injection}
              onChange={handleInputChange}
              placeholder="Enter Injection value"
            />
            <label htmlFor="unit_billed">Unit Billed:</label>
            <input
              type="number"
              id="unit_billed"
              name="unit_billed"
              value={formData.unit_billed}
              onChange={handleInputChange}
              placeholder="Enter Unit Billed value"
            />
          </div>
          {/* ... */}
          <div>
            <label htmlFor="total_IRCA_collection">Total IRCA Collection:</label>
            <input
              type="number"
              id="total_IRCA_collection"
              name="total_IRCA_collection"
              value={formData.total_IRCA_collection}
              onChange={handleInputChange}
              placeholder="Enter Total IRCA Collection value"
            />
          </div>

          <div>
            <label htmlFor="demand_IRCA">Current Demand IRCA:</label>
            <input
              type="number"
              id="demand_IRCA"
              name="demand_IRCA"
              value={formData.demand_IRCA}
              onChange={handleInputChange}
              placeholder="Enter Current Demand IRCA value"
            />
          </div>

          <div>
            <label htmlFor="no_of_consumers">No of Consumers:</label>
            <input
              type="number"
              id="no_of_consumers"
              name="no_of_consumers"
              value={formData.no_of_consumers}
              onChange={handleInputChange}
              placeholder="Enter No of Consumers in a sub-division"
            />
          </div>

          <div>
            <label htmlFor="no_of_bill_served">No of Bill Served:</label>
            <input
              type="number"
              id="no_of_bill_served"
              name="no_of_bill_served"
              value={formData.no_of_bill_served}
              onChange={handleInputChange}
              placeholder="Enter No of Bill Served in a sub-division"
            />
          </div>

          <div>
            <label htmlFor="total_area">Total Area:</label>
            <input
              type="number"
              id="total_area"
              name="total_area"
              value={formData.total_area}
              onChange={handleInputChange}
              placeholder="Enter Total Area"
            />
          </div>


            <button type="button" onClick={handleSubmit}>
                                Submit
                            </button>

        </form>
        </>
        )}
      </div>
    </div>
  );
};

export default SubmissionContent;
